To troubleshoot this, even further, in the nginx config file usually found at `/etc/nginx/sites-available/default`, check if the `ssl_certificate` and `ssl_certificate_key` directives point to the correct files:

```bash`
server {
    listen 443 ssl;
    server_name example.com;

    ssl_certificate /etc/nginx/certs/240110_certs/fullchain.pem;
    ssl_certificate_key /etc/nginx/certs/240110_certs/private.pem;
   ...
}
```

Make sure that the private key file (`private.pem`) matches the certificate file (`fullchain.pem`).
